import React from "react";
function list() {
  return (
    <ul>
      <li>
        Bacon
        <img alt="" className="" src="https://picsum.photos/200" />
      </li>
      <li>
        Jamon
        <img alt="" className="" src="https://picsum.photos/200" />
      </li>
      <li>
        Noodles +
        <img alt="" className="" src="https://picsum.photos/200" />
      </li>
    </ul>
  );
}
export default list;
